import React from "react"
import { Navigation } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

import PickCarouselItem from "./PickCarouselItem";

import 'swiper/scss';
import 'swiper/scss/navigation';

const PickCarousel = () => {
  const datas = [
    {
      "image": "Pick_1_1_800x",
      "itemLabel": true,
      "name": "Calya Cardigan Grey",
      "price": "Rp 625,000",
      "color": "Grey",
      "backToStock": true,
    }
  ];

  return (
    <Swiper
      spaceBetween={20}
      slidesPerView={4}
      slidesPerGroup={4}
      modules={[Navigation]}
      grabCursor={true}
      navigation
    >
      {datas.map((data, i) => {
        return (
          <SwiperSlide>
            <PickCarouselItem data={data} key={i} />
          </SwiperSlide>
        )
      })}
    </Swiper>
  )
}

export default PickCarousel
